import { React, useState } from "react";
import { Container } from "react-bootstrap";
import Beitrag from "../Beitrag";
 
const BeitragDeck = (props) => {
  const [bei, setBei] = useState(undefined);
  let beitraege = props.data
  if(beitraege === undefined || beitraege === 0 || beitraege === null)return(<h3 className = "m-5">Beitraege nicht geladen</h3>);
  else{
    if(bei !== undefined)setBei(Array.prototype.push.apply(bei, beitraege));
    else setBei(beitraege);
  }
  console.log(bei)
  if(bei === undefined)return(<h3 className = "m-5">Beitraege nicht geladen</h3>);
  return (
    <Container className = {props.className2}>
        {bei.map((e,i) => {
          return (<Beitrag  name = {e.ueberschrift} text = {e.text} img = {e.img} ersteller = {e.ersteller} key1 = {i} likes = {e.likes} key = {i}/>)
        })}
      </Container>
  );
};

export default BeitragDeck;
